import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faRocket, faComment } from "@fortawesome/free-solid-svg-icons";

const Boxes = () => {
  return (
    <nav className="box">
      <a className="box-1" href="#section-3-project">
        <h2 className="box-title"> Frontend developer Ô∏Å</h2>
        <FontAwesomeIcon
          className="fa-boxes"
          icon={faRocket}
          color="white"
          size="1.5x"
        />
      </a>

      <a className="box-2 box-title">My entrepre neurship</a>
      <a className="box-3 box-title">Know me better</a>
      <a className="box-4 box-title">
        <h2 className="box-title">Let's get in touch </h2>
        <FontAwesomeIcon
          className="fa-boxes"
          icon={faComment}
          color="white"
          size="1x"
        />
      </a>
    </nav>
  );
};

export default Boxes;
